import React, { Component } from 'react'
import { overviewData } from '../api'

export class FinancialRatios extends Component {
    constructor(props) {
        super(props)
        this.state = {
            activeTicker: 'NVDA',
            ratioList: {

                "MarketCapitalization": "110565384192",
                "EBITDA": "15576999936",
                "PERatio": "14.2029",
                "PEGRatio": "8.7328",
                "BookValue": "23.076",
                "DividendPerShare": "6.52",
                "EPS": "8.811",
                "ReturnOnAssetsTTM": "0.0362",
                "ReturnOnEquityTTM": "0.4097",
                "TrailingPE": "14.2029",
                "ForwardPE": "11.2613",
                "PriceToSalesRatioTTM": "1.4836",
                "PriceToBookRatio": "5.4286"

            }
        }
    }



    render() {

        const ratioList = this.state.ratioList

        const ratioMap = ratioList.map((item) => 
            <li key={item.activeTicker}> {item.MarketCapitalization} </li>
        )



        return (
            <div>
                {ratioMap}
            </div>
        )
    }
}

export default FinancialRatios
